import './App.css';
import data from './OpenDay.json';


function App() {
  return (
    <div className="App">
      <header className="App-header">
      <main>
        <ul>
          {data.items.map(item => (
              <h2>{item.programs}</h2>
          ))}
        </ul>
      </main>
      </header>
    </div>
  );
}

export default App;
